identity: 'user',
datastore: 'myMongo',
autoPK: false,
attributes: {
    id: {
        type: 'integer',
        autoIncrement: true,
        primaryKey: true
    },
    email: {
        type: 'string',
        email: true,
        required: true,
        unique: true
    },
    username: {
        type: 'string',
        required: true,
    },

    image: {
        type: 'string'
    },

    password: {
        type: 'string',
        required: true
    },

    mobNo: {
        type: 'string',
        required: true
    },
    aadharNo: {
        type: 'string',
        required: true
    },

