<pre><code>const document = {
  name: 'some name',
  text: 'some text,
  file_type: 'file type',
  urls: [{
    path: 'some path',
    display_url: 'some path',
  }],
};
</code></pre>

<p>I have <code>DocumentSchema</code> and <code>URLSchema</code> created looking like this:</p>

<pre><code>const DocumentSchema = new Schema({
  text: String,
  file_type: String,
  name: String,
  urls: [{ type: Schema.Types.ObjectId, ref: 'URL' }],
});

const URLSchema = new Schema({
  path: String,
