MongoDB - Populate document field recursively<p>I've got a <code>Page</code>:</p>

<pre><code>const PageSchema = new Schema({
  children: [{type: mongoose.Schema.Types.ObjectId, ref: 'Page'}]
});
</code></pre>

<p>As you can see each <code>Page</code> has an array of <code>children</code> which is also a <code>Page</code>.</p>

<p>Now what I need to do is fetch all "main" pages and populate their <code>children</code> array, easy enough except for the fact that I need to do this recursively since a <code>Page</code> contains an array of <code>Page</code>s. </p>

<p>MongoDB doesn't have any out of the box support for this, it only supports a 2 level deep population. </p>

<p>Here's my current query (removed all extra stuff for readability) without using the current <code>.populate</code> method (since it's not gonna work anyway): </p>

<pre><code>Page.find(query)
  .exec((err, pages) =&gt; {

    if (err) {
      return next(err);
    }

    res.json(pages);
  });
</code></pre>

<p>I looked at this question which is similar but not exactly what I need:</p>

<p><a href="https://stackoverflow.com/questions/26041262/mongoose-recursive-populate">mongoose recursive populate</a></p>

<p>That seems to use a parent to populate recursively and it also starts from just 1 document, rather than my scenario which uses an array of documents since I'm using <code>.find</code> and not <code>.findOne</code> for example.</p>

<p><strong>How can I create my own deep recursive populate function for this?</strong></p>

<p>Sidenote:</p>

<p>I am aware that the solution I need isn't recommended due to performance but I've come to the conclusion that it is the <strong>only</strong> solution that is going to work for me. I need to do recursive fetching regardless if it's in the frontend or backend, and doing it right in the backend will simplify things massively. Also the number of pages won't be big enough to cause performance issues.</p>

